INSERT INTO `product` VALUES (1,2,'Cuối cùng thì chiếc iPhone 14 Pro Max cũng đã chính thức lộ diện tại sự kiện ra mắt thường niên vào ngày 08/09 đến từ nhà Apple, kết thúc bao lời đồn đoán bằng một bộ thông số cực kỳ ấn tượng cùng vẻ ngoài đẹp mắt sang trọng. Từ ngày 14/10/2022 người dùng đã có thể mua sắm các sản phẩm iPhone 14 series với đầy đủ phiên bản tại Thế Giới Di Động. Thiết kế cao cấp và vẻ ngoài sành điệu\r\nSản phẩm có trong mình một diện mạo bắt mắt nhờ lối tạo hình vuông vức bắt trend tương tự thế hệ iPhone 13 series, đây được xem là kiểu thiết kế rất thành công trên các thế hệ trước khi tạo nên cơn sốt toàn cầu về kiểu dáng điện thoại cho đến nay. ',_binary '',_binary '','Điện thoại iPhone 14 Pro Max 128GB',1000,1),(5,10,'Thiết kế mang dáng vẻ sang trọng và đặc trưng\r\nĐến với thiết kế của iPhone 14 Pro năm nay, hãng vẫn giữ lại nét đặc trưng vốn có từ các đời trước, vẫn mang trong mình ngoại hình vuông vức với các cạnh và mặt lưng vát phẳng. Hiện tại thị hiếu của người dùng về kiểu thiết kế này vẫn đang rất cao, vậy nên theo mình thấy thì đây vẫn sẽ là chiếc điện thoại bắt trend cho trong nhiều năm tiếp theo.\r\n\r\nThiết kế sang trọng - iPhone 14 Pro 128GB\r\n\r\nBộ khung điện thoại được làm từ chất liệu thép không gỉ và hoàn thiện theo kiểu bóng nhoáng, điều này giúp thiết bị trở nên bền bỉ cũng như làm tăng thêm phần sang trọng. Mỗi khi nghiêng máy qua nhiều góc độ khác nhau mình thấy phần khung này trở nên cuốn hút hơn nhờ khả năng phản quang vô cùng thú vị.\r\n\r\nKhung viền sáng bóng - iPhone 14 Pro 128GB\r\n\r\nSau một thời gian sử dụng, mình thấy bộ khung này khá là dễ bám dấu vân tay, sử dụng điện thoại khi tay có mồ hôi cũng sẽ trở nên khó khăn hơn đôi chút bởi máy lúc này khá trơn. Để khắc phục được hai việc trên thì người dùng cũng có thể dùng thêm ốp lưng để đảm bảo quá trình sử dụng được thuận tiện nhất.\r\n\r\nDễ bám dấu vân tay - iPhone 14 Pro 128GB\r\n\r\nVề phần mặt lưng, vật liệu cấu tạo chính sẽ là kính cường lực và được hoàn thiện nhám để cho ra cái nhìn cao cấp hơn, mình cảm thấy cách làm nhám này cũng đã khắc phục được đáng kể tình trạng bám dấu vân tay so với mặt lưng bóng trên iPhone 14.\r\n\r\nHạn chế vết xước - iPhone 14 Pro 128GB\r\n\r\nĐối với iPhone 14 Pro, màu sắc đặc trưng sẽ là màu tím, đây được dự đoán là phiên bản màu bán chạy nhất bởi sự đặc trưng và dễ dàng nhận diện. ',_binary '',_binary '','Điện thoại iPhone 14 Pro 128GB',900,1),(6,8,'Có lẽ điện thoại gập đã không còn là cái tên quá xa lạ bởi nhiều ông lớn trong ngành sản xuất thiết bị di động đã cho ra mắt khá nhiều sản phẩm có thiết kế tương tự, gần đây nhất thì có sự góp mặt của chiếc flagship đến từ nhà Samsung mang tên Galaxy Z Flip4. \r\n\r\nThiết kế cao cấp - Samsung Galaxy Z Flip4\r\n\r\nNgay từ những giây phút đầu tiên sử dụng chiếc Galaxy Z Flip4 mình đã cảm nhận được sự khác biệt của nó so với thế hệ trước, máy bây giờ đã vuông vắn hơn nhờ tạo hình vát phẳng ở hai mặt và các cạnh.\r\n\r\nNgoại hình vuông vức - Samsung Galaxy Z Flip4\r\n\r\nPhần mặt lưng của máy được phủ một lớp nhám nhẹ giúp cho mình có thể cầm nắm chắc tay hơn, hạn chế được tình trạng bám dấu vân tay trong quá trình sử dụng.',_binary '',_binary '','Điện thoại Samsung Galaxy Z Flip4 128GB',800,2),(7,5,'Galaxy Z Fold4 (2022) ra mắt với ngoại hình gần như là không đổi khi so với Galaxy Z Fold3, nếu bạn chỉ nhìn bề ngoài thì bạn sẽ khó lòng phân biệt được 2 sản phẩm này. Máy vẫn sử dụng khung viền Armor Aluminum bền bỉ, mặt kính màn hình phụ là Corning Gorilla Glass Victus+, mặt kính màn hình chính là Ultra Thin Glass.\r\n\r\nTạo khác biệt với màn hình gập, mở - Samsung Galaxy Z Fold4 256GB\r\n\r\nVà đây cũng là chiếc điện thoại gập bền bỉ nhất giới smartphone khi kết hợp với khả năng kháng nước chuẩn IPX8, có khả năng ngâm trong nước ngọt ở độ sâu tới 1.5 mét trong thời gian tối đa 30 phút* (máy không có khả năng kháng bụi).\r\n\r\n*Thông tin hãng Samsung cung cấp\r\n\r\nĐiện thoại kháng nước - Samsung Galaxy Z Fold4\r\n\r\nNăm nay Z Fold4 có thiết kế cân bằng hơn, bản lề và viền màn hình được thiết kế mỏng hơn giúp tổng thể ở màn hình phụ của máy rộng thêm 2.7 mm và màn hình chính rộng hơn 3 mm khi so với thế hệ tiền nhiệm. Tuy con số không quá lớn nhưng với trải nghiệm thực tế thì đây là một thay đổi cực kỳ đáng giá và mang lại hiệu quả sử dụng cao.',_binary '',_binary '','Điện thoại Samsung Galaxy Z Fold4 256GB ',1000,2);
INSERT INTO `product` VALUES (8,8,'Thiết kế trẻ trung thu hút ánh nhìn\r\nOPPO Reno8 T 5G sở hữu lối thiết kế hiện đại với màu sắc trẻ trung phù hợp với mọi lứa tuổi. Mặt lưng máy được hoàn thiện bằng thủy tinh hữu cơ đồng thời vát cong sang hai bên mang đến cảm giác cầm nắm tốt, không bị cấn tay trong quá trình sử dụng. Khung viền của máy được làm từ hợp kim giúp bảo vệ máy tốt hơn đồng thời tạo sự sang trọng cho điện thoại.\r\n\r\nThiết kế hiện đại - OPPO Reno8 T 5G\r\n\r\nMàn hình phía trước được thiết kế kiểu đục lỗ giúp tăng diện tích hiển thị, kèm với đó màn hình được làm cong sang hai bên cho cảm giác vuốt chạm và trải nghiệm thị giác tốt hơn khi sử dụng.\r\n\r\nTrải nghiệm hình ảnh một cách sắc nét\r\nNhằm đem đến trải nghiệm tốt nhất cho người dùng OPPO đã mang tấm nền AMOLED kích thước 6.7 inch lên trên Reno8 T 5G giúp bạn sẽ đắm chìm trong những thước phim với hình ảnh đẹp mắt, màu sắc rực rỡ.\r\n\r\nGiúp cho hình ảnh được hiển thị chi tiết và rõ ràng hơn thì hãng đã không ngần ngại trang bị độ phân giải Full HD+ đi cùng tần số quét 120 Hz cho bạn những phút giây giải trí trọn vẹn sau một ngày làm việc mệt mỏi.\r\n\r\nThổi hồn vào từng bức ảnh\r\nKhông chỉ mang một vẻ ngoài đẹp mắt mà Reno8 T 5G cũng cho khả năng chụp ảnh đẹp mắt. Thông số camera chính của máy lên đến 108 MP đi cùng với đó là 2 cảm biến phụ 2 MP, đem đến những bức ảnh rực rỡ, có chiều sâu mà bạn không cần tốn quá nhiều thời gian để chỉnh sửa.\r\n\r\n',_binary '',_binary '','Điện thoại OPPO Reno8 T 5G 256GB',500,3),(9,11,'Dáng vẻ cao cấp sang trọng\r\nLần này nhà OPPO mang đến cho chúng ta một chiếc điện thoại có thiết kế đặc biệt, máy sở hữu một diện mạo khác hẳn với những chiếc điện thoại OPPO Reno trước đây, cách thiết kế này đã làm mình liên tưởng đến chiếc OPPO Find X5 Pro được ra mắt trước đó.\r\n\r\nNgoại hình thời trang - OPPO Reno8 Pro 5G\r\n\r\nMặt lưng của điện thoại làm từ kính và được hoàn thiện bóng giúp máy trở nên nổi bật hơn, phần này bóng bẩy đến mức mình có thể soi gương một cách trực tiếp đối với phiên bản màu đen. Tuy nhiên đây cũng có thể coi như một điểm hạn chế bởi mặt lưng máy khá dễ bám dấu vân tay.\r\n\r\nMặt lưng sáng bóng - OPPO Reno8 Pro 5G\r\n\r\nMặt lưng của Reno8 Pro chính là kính cường lực Gorilla Glass 5, loại vật liệu này có khả năng hạn chế xước khá tốt giúp cho phần mặt lưng máy được trở nên bền bỉ hơn.\r\n\r\nMặt lưng kính cường lực - OPPO Reno8 Pro 5G\r\n\r\nĐiểm mình ấn tượng nhất ở phần thiết kế là tạo hình bo cong tại vị trí tiếp giáp giữa mặt lưng và cụm camera. Điều này giúp cho máy có được cái nhìn liền mạch và đồng nhất hơn, cảm giác như máy được đúc từ một khối, nhìn cực kỳ chắc chắn.',_binary '',_binary '','Điện thoại OPPO Reno8 Pro 5G',700,3);
INSERT INTO `product` VALUES (10,24,'Realme 10 có thể xem là một trong những mẫu smartphone đáng mong đợi nhất trong dịp đầu năm 2023 với nhiều điểm nổi bật, một số điểm đáng chú ý có thể kể đến như: Tấm nền Super AMOLED, camera siêu độ phân giải 50 MP đi kèm con chip Helio G99 mạnh mẽ.\r\nTỏa sáng với diện mạo đầy mới lạ\r\nRealme 10 có một ngoại hình vuông vắn nhờ lối tạo hình phẳng ở các mặt và cạnh viền. Tổng khối lượng của máy đạt 178 g, vậy nên khi sử dụng lâu dài sẽ giúp giảm thiểu việc mỏi tay, điều này thực sự hữu ích dành cho những ai thường xuyên phải sử dụng điện thoại trong nhiều giờ liền.',_binary '',_binary '','Điện thoại Realme 10',300,6),(11,14,'Realme 9 Pro+ 5G - chiếc smartphone tầm trung của Realme đã được ra mắt, máy có một thiết kế đầy màu sắc, cụm 3 camera với cảm biến IMX766 giúp bạn có được những bức ảnh sinh động.\r\nThiết kế màu sắc thay đổi theo ánh sáng\r\nRealme 9 Pro+ 5G với thiết kế Light Shift trên phiên bản Lam Hừng Đông hoàn toàn mới, có thể thay đổi màu từ xanh lam nhạt sang đỏ khi tiếp xúc với ánh sáng mặt trời đẹp tựa như cảnh bình minh. Còn một phiên bản màu khác là Lục Cực Quang cũng cực kỳ đẹp mắt.',_binary '',_binary '','Điện thoại Realme 9 Pro+ 5G',400,6),(12,21,'Tiếp nối sự thành công của các mẫu smartphone tầm trung tại thị trường Việt Nam thì mới đây Vivo đã chính thức cho ra mắt điện thoại Vivo Y35. Máy sở hữu cho mình khả năng sạc siêu nhanh 44 W, cụm camera đem đến những bức ảnh sắc nét và một hiệu năng ổn định trong phân khúc.\r\nKhông gian hiển thị sắc nét\r\nVivo Y35 có kích thước màn hình 6.58 inch đi cùng là tấm nền IPS LCD, độ phân giải Full HD+ với những thông số trên chất lượng hình ảnh hiển thị có chi tiết tốt, góc nhìn rộng và màu sắc trung thực.\r\n\r\n',_binary '',_binary '','Điện thoại Vivo Y35 ',250,4);
INSERT INTO `product` VALUES (13,17,'Vivo dường như ngày càng chú trọng vào vẻ đẹp của từng sản phẩm khi có khá nhiều mẫu smartphone mới được trình làng với bề ngoài hết sức đẹp mắt, nổi bật trong khoảng thời gian gần đây (09/2022) có lẽ là Vivo Y22s (4GB/128GB) khi sở hữu cho mình một diện mạo vuông vức, thời thượng cùng mức giá bán cũng không kém phần ấn tượng.\r\nVẻ đẹp thu hút mọi ánh nhìn\r\nY22s là một chiếc điện thoại Vivo dòng Y có lối tạo hình vuông vức, các chi tiết được hãng gia công tinh tế đến từng đường nét nhỏ nhất.',_binary '',_binary '','Điện thoại Vivo Y22s 4GB',200,4),(14,5,'Cuối cùng Xiaomi 12T Pro 5G cũng đã chính thức lộ diện trên thị trường sau hàng loạt thông tin rò rỉ về thông số, đúng như dự đoán thì độ phân giải trên camera của phiên bản này được nhà sản xuất nâng cấp lên đến 200 MP, giúp máy trở thành thiết bị có khả năng ghi hình sắc nét thuộc top đầu giới smartphone, đi kèm với đó là màn hình chất lượng cùng bộ vi xử lý mạnh mẽ xứng tầm flagship.\r\nTạo hình cao cấp sang trọng\r\nLần ra mắt này nhà Xiaomi mang đến cho chúng ta một chiếc điện thoại có thiết kế quen thuộc, hai cạnh bên được làm bo cong ôm về phía trước cùng cách bố trí cụm camera trông khá vuông vắn, đây được xem là lối tạo hình cực kỳ thành công từ thế hệ trước.',_binary '',_binary '','Điện thoại Xiaomi 12T Pro 5G',700,5);
